/**
 * Play sound effect to enhance UI interactions
 * @param {SoundEffect} effectName - name of sound effect
 */
export function playSoundEffect(effectName: "bloop"| "boop"|"buzz"|"bounce"|"shutter"|"finalBeep") {
  if (effectName in soundEffectData == false || typeof Audio === "undefined")
    return {error:("Could not play sound")}
try{
  void new Audio(
      "data:audio/mp3;base64," + soundEffectData[effectName]
    ).play();
} catch(e){ 
  return {error: "Sound effect failed to play"}

}
  return {error: false}
}

const soundEffectData = {
  boop: "",
  buzz: "",
  bounce: "",
  shutter: "",
  bloop: "",
  finalBeep: ""
};
